import React, { Component } from 'react';



//import'./game.css'

const GameComponent = {
    height: "500px",
    width: "500px",
    display: "flex",
    flexWrap: "wrap",
    border: "1px solid black",
    boxSizing: "border-box"
}



export default class Game extends Component {

     render() {

        return (

            <div style = {GameComponent}>
                <div style={{
                    width: this.props.sizeEasyMode,
                    height: this.props.sizeEasyMode,
                    display: "flex",
                    flexWrap: "wrap",
                    border: "1px solid black",
                    boxSizing: "border-box"




                }}
                         id='duel1'></div>
                <div className='cell' id='duel2'></div>
                <div className='cell' id='duel3'></div>
