                <div className='cell' id='duel6'></div>
                <div className='cell' id='duel7'></div>
                <div className='cell' id='duel8'></div>
                <div className='cell' id='duel9'
                     style = {{
                         width: this.props.sizeEasyMode ,
                         height: this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel10'
                     style = {{
