                     style = {{
                         'width': this.props.sizeEasyMode ,
                         'height': this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel17'
                     style = {{
                         'width': this.props.sizeEasyMode ,
                         'height': this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel18'
