                         'height': this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel22'
                     style = {{
                         'width': this.props.sizeEasyMode ,
                         'height': this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel23'
                     style = {{
                         'width': this.props.sizeEasyMode ,
                         'height': this.props.sizeEasyMode }}></div>
                <div className='cell' id='duel24'
                     style = {{
